INSERT INTO public."ChapterSections" VALUES (26, 1, '1.1. Nguyên tắc hoạt động của Web', 'Mối quan hệ giữa Internet và Web, địa chỉ trang web, phân tích một trang web, trình duyệt web', 1);
INSERT INTO public."ChapterSections" VALUES (27, 1, '1.2. Tiến trình thiết kế web', 'Hình thành ý tưởng, tạo và tổ chức nội dung, phác thảo giao diện mẫu, tạo hồ sơ tài liệu HTML, kiểm thử và chỉnh sửa, xuất bản trang web', 2);
INSERT INTO public."ChapterSections" VALUES (28, 1, '1.3. Công cụ phân tích, kiểm lỗi và tối ưu hóa mã nguồn tự động (Linting tools)', 'Khái niệm Linting, các công cụ Linting phổ biến, các quy tắc chuẩn về chuẩn hóa mã nguồn', 3);
INSERT INTO public."ChapterSections" VALUES (29, 2, '2.1. Tạo một trang web đơn giản', 'Lịch sử phát triển HTML, giới thiệu về thẻ HTML, cấu trúc một tài liệu HTML, trình duyệt web, trình soạn thảo', 1);
INSERT INTO public."ChapterSections" VALUES (30, 2, '2.2. Định dạng văn bản với HTML', 'Định dạng tiêu đề, định dạng văn bản, danh sách đề mục, tạo ghi chú', 2);
INSERT INTO public."ChapterSections" VALUES (31, 2, '2.3. Bổ sung các đối tượng đồ họa', 'Bổ sung hình ảnh, bổ sung âm thanh, bổ sung Video, bổ sung Plug-in, bổ sung YouTube Video', 3);
INSERT INTO public."ChapterSections" VALUES (32, 2, '2.4. Tạo các siêu liên kết', 'Tạo siêu liên kết, tạo siêu liên kết đến iframe, tạo siêu liên kết dạng hình ảnh', 4);
INSERT INTO public."ChapterSections" VALUES (33, 2, '2.5. Thiết kế form nhập liệu', 'Cấu trúc form trong HTML, các thành phần nhập liệu', 5);
INSERT INTO public."ChapterSections" VALUES (34, 2, '2.6. Tổng quan về HTML DOM, Google Fonts, Google Chart, Google Map', NULL, 6);
