INSERT INTO public."Levels" VALUES (1, 'Dễ');
INSERT INTO public."Levels" VALUES (2, 'Trung bình');
INSERT INTO public."Levels" VALUES (3, 'Khó');
INSERT INTO public."PLOs" VALUES (1, 'Vận dụng kiến thức cơ bản về khoa học tựnhiên, khoa học xã hội, khoa học chính trị và pháp luật để giải quyết vấn đề liên quan chuyên ngành.', 1, 'PLO1');
INSERT INTO public."PLOs" VALUES (2, 'Kết hợp kiến thức chuyên môn để giải quyết các vấn đề liên quan công nghệ thông tin.', 1, 'PLO2');
INSERT INTO public."PLOs" VALUES (3, 'Phân tích các vấn đề tính toán phức tạp để xác định các giải pháp bằng cách áp dụng các nguyên lý của máy tính và công nghệ thông tin.', 1, 'PLO3');
INSERT INTO public."PLOs" VALUES (4, 'Triển khai các giải pháp công nghệ thông tin bằng cách đánh giá, thiết kế và cài đặt để đáp ứng yêu cầu thực tế.', 1, 'PLO4');
INSERT INTO public."PLOs" VALUES (5, 'Kết hợp các giải pháp có tính hệ thống để lựa chọn, phát triển, áp dụng, tích hợp và quản trị an toàn các hệ thống công nghệ thông tin nhằm đạt được các mục tiêu của người dùng.', 1, 'PLO5');
INSERT INTO public."PLOs" VALUES (6, 'Sử dụng tốt tiếng Anh trong soạn thảo, đọc tài liệu và giao tiếp, đạt bậc 3/6 theo khung năng lực ngoại ngữ của Việt Nam.', 1, 'PLO6');
INSERT INTO public."PLOs" VALUES (7, 'Phối hợp tốt các kỹ năng trình bày và giao tiếp trong bối cảnh nghề nghiệp.', 1, 'PLO7');
INSERT INTO public."PLOs" VALUES (8, 'Phối hợp hiệu quả các kỹ năng làm việc nhóm với tư cách là thành viên hoặc người lãnh đạo.', 1, 'PLO8');
INSERT INTO public."PLOs" VALUES (9, 'Tôn trọng trách nhiệm nghề nghiệp để đưa ra các đánh giá chuyên môn dựa trên chuẩn mực đạo đức và pháp luật.', 1, 'PLO9');
INSERT INTO public."PLOs" VALUES (10, 'Tôn trọng sự cần thiết của quá trình học tập suốt đời.', 1, 'PLO10');
INSERT INTO public."POs" VALUES (1, 'PO1', 'Có kiến thức cơ bản về khoa học xã hội, khoa học chính trị, pháp luật, ngoại ngữ, có tinh thần trách nhiệm và ý thức tổ chức kỷ luật tốt.', 1);
INSERT INTO public."POs" VALUES (2, 'PO2', 'Có kiến thức và kỹ năng chuyên môn trong lĩnh vực công nghệ thông tin, đáp ứng yêu cầu của cách mạng công nghiệp 4.0.', 1);
INSERT INTO public."POs" VALUES (3, 'PO3', 'Có khả năng làm việc hiệu quả trong lĩnh vực công nghệ thông tin, tạo ra những đóng góp tích cực cho xã hội.', 1);
INSERT INTO public."POs" VALUES (4, 'PO4', 'Có khả năng làm việc độc lập hoặc làm việc theo nhóm, hướng dẫn, giám sát những người khác thực hiện nhiệm vụ trong lĩnh vực công nghệ thông tin.', 1);
INSERT INTO public."POs" VALUES (5, 'PO5', 'Có khả năng khám phá tri thức, giải quyết vấn đề, tư duy hệ thống, phát triển phẩm chất cá nhân và nghề nghiệp thông qua hoạt động học tập suốt đời.', 1);
