INSERT INTO public."Subjects" VALUES (1, 1, 1, ' Thiết kế web', 'Học phần giúp trang bị cho sinh viên các kiến thức cơ sở về thiết kế web bằng ngôn ngữ HTML, CSS, Javascript và các front-end framework. Đồng thời học phần cũng nhằm rèn luyện cho sinh viên các kỹ năng tổ chức mã nguồn và thiết kế giao diện website có bố cục hợp lý, màu sắc hài hòa và thân thiện với người dùng. Học phần cũng giúp hình thành cho sinh viên thái độ và nhận thức đúng đắn về khả năng của các dịch vụ mạng Internet và web hiện nay; kỹ năng làm việc nhóm, làm việc độc lập và trình bày báo cáo.', '2025-01-01');
INSERT INTO public."Subjects" VALUES (2, 1, 2, 'Kỹ thuật lập trình', 'Học phần giúp trang bị cho sinh viên các kiến thức cơ bản về kỹ thuật lập trình giải quyết bài toán trên máy tính. Đồng thời, học phần cũng nhằm rèn luyện cho sinh viên các kỹ năng phân tích bài toán, xây dựng giải thuật, lập trình giải các bài toán trên máy tính bằng ngôn ngữ lập trình C với giải thuật hiệu quả. Học phần cũng giúp hình thành cho sinh viên thái độ và nhận thức đúng đắn về tầm quan trọng của học phần và phương pháp lập trình trên máy tính.', '2025-01-01');
