--

CREATE FUNCTION public.calculate_grade(score numeric) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF score IS NULL THEN RETURN NULL; END IF;
    IF score >= 9.0 THEN RETURN 'A+'; END IF;
    IF score >= 8.5 THEN RETURN 'A'; END IF;
    IF score >= 8.0 THEN RETURN 'B+'; END IF;
    IF score >= 7.0 THEN RETURN 'B'; END IF;
    IF score >= 6.5 THEN RETURN 'C+'; END IF;
    IF score >= 5.5 THEN RETURN 'C'; END IF;
    IF score >= 5.0 THEN RETURN 'D+'; END IF;
    IF score >= 4.0 THEN RETURN 'D'; END IF;
    RETURN 'F';
END;
$$;


