--
-- TOC entry 408 (class 1255 OID 18605)
-- Name: update_user_social_stats(); Type: FUNCTION; Schema: public; Owner: root
--

CREATE FUNCTION public.update_user_social_stats() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Update stats when user unlocks new emoji
    IF TG_TABLE_NAME = 'UserEmojis' AND TG_OP = 'INSERT' THEN
        VALUES (NEW.user_id, 1, CURRENT_TIMESTAMP)
        ON CONFLICT ("user_id") 
        DO UPDATE SET 
            "total_emojis_unlocked" = "UserSocialStats"."total_emojis_unlocked" + 1,
            "updated_at" = CURRENT_TIMESTAMP;
    END IF;
    
    -- Update stats when user uses emoji
    IF TG_TABLE_NAME = 'EmojiUsageHistory' AND TG_OP = 'INSERT' THEN
        -- Update user emoji usage count
        UPDATE "UserEmojis" 
        SET "usage_count" = "usage_count" + 1,
            "updated_at" = CURRENT_TIMESTAMP
        WHERE "user_id" = NEW.user_id AND "emoji_type_id" = NEW.emoji_type_id;
        
        -- Update user social stats
        VALUES (NEW.user_id, 1, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP)
        ON CONFLICT ("user_id") 
        DO UPDATE SET 
            "total_emoji_usage" = "UserSocialStats"."total_emoji_usage" + 1,
            "last_social_activity" = CURRENT_TIMESTAMP,
            "updated_at" = CURRENT_TIMESTAMP;
    END IF;
    
    -- Update stats for social interactions
    IF TG_TABLE_NAME = 'SocialInteractions' AND TG_OP = 'INSERT' THEN
        -- Update sender stats
        VALUES (NEW.from_user_id, CASE WHEN NEW.is_positive THEN 1 ELSE 0 END, CURRENT_TIMESTAMP)
        ON CONFLICT ("user_id") 
        DO UPDATE SET 
            "positive_interactions_sent" = "UserSocialStats"."positive_interactions_sent" + CASE WHEN NEW.is_positive THEN 1 ELSE 0 END,
            "updated_at" = CURRENT_TIMESTAMP;
            
        -- Update receiver stats
        VALUES (NEW.to_user_id, CASE WHEN NEW.is_positive THEN 1 ELSE 0 END, CURRENT_TIMESTAMP)
        ON CONFLICT ("user_id") 
        DO UPDATE SET 
            "positive_interactions_received" = "UserSocialStats"."positive_interactions_received" + CASE WHEN NEW.is_positive THEN 1 ELSE 0 END,
            "updated_at" = CURRENT_TIMESTAMP;
    END IF;
    
    RETURN COALESCE(NEW, OLD);
END;
$$;


ALTER FUNCTION public.update_user_social_stats() OWNER TO root;

--
-- TOC entry 429 (class 1255 OID 35786)
-- Name: validate_assessment_quiz_mapping(); Type: FUNCTION; Schema: public; Owner: root
--

CREATE FUNCTION public.validate_assessment_quiz_mapping() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    q_mode TEXT;
    q_course INT;
    col_course INT;
BEGIN
    SELECT quiz_mode::text, course_id INTO q_mode, q_course FROM "Quizzes" WHERE quiz_id = NEW.quiz_id;
    IF q_mode IS NULL THEN
        RAISE EXCEPTION 'Quiz % not found', NEW.quiz_id;
    END IF;
    IF q_mode <> 'assessment' THEN
        RAISE EXCEPTION 'Only assessment quizzes can be mapped to grade columns (quiz_id=%, mode=%)', NEW.quiz_id, q_mode;
    END IF;

    SELECT course_id INTO col_course FROM "CourseGradeColumns" WHERE column_id = NEW.column_id;
    IF col_course IS NULL THEN
        RAISE EXCEPTION 'Grade column % not found', NEW.column_id;
    END IF;
    IF q_course <> col_course THEN
        RAISE EXCEPTION 'Quiz course % does not match column course % (quiz_id=%, column_id=%)', q_course, col_course, NEW.quiz_id, NEW.column_id;
    END IF;

    RETURN NEW;
END;$$;


ALTER FUNCTION public.validate_assessment_quiz_mapping() OWNER TO root;

--
-- TOC entry 427 (class 1255 OID 27422)
-- Name: validate_column_weight_total(integer); Type: FUNCTION; Schema: public; Owner: root
--

CREATE FUNCTION public.validate_column_weight_total(p_column_id integer) RETURNS TABLE(column_id integer, total_weight numeric, is_valid boolean, message text)
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_total DECIMAL;
BEGIN
    -- Tính tổng weight_percentage của cột
    SELECT COALESCE(SUM(weight_percentage), 0) 
    INTO v_total
    FROM "CourseGradeColumnQuizzes" 
    WHERE column_id = p_column_id 
    AND weight_percentage IS NOT NULL;
    
    RETURN QUERY SELECT 
        p_column_id,
        v_total,
        CASE 
            WHEN v_total = 0 THEN true  -- Không có weight nào được set
            WHEN ABS(v_total - 100) <= 0.01 THEN true  -- Tổng = 100%
            ELSE false
        END as is_valid,
        CASE 
            WHEN v_total = 0 THEN 'No weights set - using equal distribution'
            WHEN ABS(v_total - 100) <= 0.01 THEN 'Total weight is 100% - valid'
            ELSE 'Total weight is ' || v_total::TEXT || '% - should be 100%'
        END as message;
END;
$$;


ALTER FUNCTION public.validate_column_weight_total(p_column_id integer) OWNER TO root;

