--
-- TOC entry 343 (class 1259 OID 18609)
-- Name: EmojiPopularityStats; Type: VIEW; Schema: public; Owner: root
--

CREATE VIEW public."EmojiPopularityStats" AS
 SELECT et.emoji_type_id,
    et.emoji_name,
    et.emoji_code,
    et.category,
    et.tier_requirement,
    et.rarity,
    count(ue.user_emoji_id) AS total_unlocked_by_users,
    COALESCE(sum(ue.usage_count), (0)::bigint) AS total_usage_count,
    COALESCE(avg(ue.usage_count), (0)::numeric) AS avg_usage_per_user,
    count(
        CASE
            WHEN (ue.is_favorite = true) THEN 1
            ELSE NULL::integer
        END) AS favorite_count
   FROM (public."EmojiTypes" et
     LEFT JOIN public."UserEmojis" ue ON ((et.emoji_type_id = ue.emoji_type_id)))
  WHERE (et.is_active = true)
  GROUP BY et.emoji_type_id, et.emoji_name, et.emoji_code, et.category, et.tier_requirement, et.rarity
  ORDER BY COALESCE(sum(ue.usage_count), (0)::bigint) DESC;


ALTER VIEW public."EmojiPopularityStats" OWNER TO root;

